                                        namespaceURI: 'http://www.lexml.gov.br/1.0',
                                        localPart: 'Artigo',
                                        prefix: '',
                                        key: '{http://www.lexml.gov.br/1.0}Artigo',
                                        string: '{http://www.lexml.gov.br/1.0}Artigo',
