                                                        TYPE_NAME: 'br_gov_lexml__1.GenInline',
                                                        content: [
                                                          '\n São válidos, a respeito dos contratantes de boa-fé, os atos com estes ajustados em nome do mandante pelo mandatário, enquanto este ignorar a morte daquele ou a extinção do mandato, por qualquer outra causa.\n\n ',
                                                        ],
