                                                    p: [
                                                      {
                                                        TYPE_NAME: 'br_gov_lexml__1.GenInline',
                                                        content: [
                                                          '\n O transportador conduzirá a coisa ao seu destino, tomando todas as cautelas necessárias para mantê-la em bom estado e entregá-la no prazo ajustado ou previsto.\n\n ',
                                                        ],
                                                      },
                                                    ],
