                                              id: 'art981_par1u',
                                              rotulo: 'Parágrafo único.',
                                              p: [
                                                {
                                                  TYPE_NAME: 'br_gov_lexml__1.GenInline',
                                                  content: ['\n A atividade pode restringir-se à realização de um ou mais negócios determinados.\n\n '],
                                                },
                                              ],
